import React from 'react';
import s from './Dialogs.module.css'
import NavLink from "react-router-dom/es/NavLink";

const DialogItem = (props) => {
    return(
        <div className={s.dialog}>
            <NavLink to='/dialogs/{`{${props.id}`}'> {props.name}</NavLink></div>
    )
};

const Dialogs = (props) => {
  return (
      <div className={`${s.dialogs} ${s.grid}`}>
          <div className={s.dialogsItem}>
              <DialogItem name='Роман' id='1'/>
              <div className={s.dialog}>Сергей</div>
              <div className={s.dialog}>Артем</div>
              <div className={s.dialog}>Катя</div>
              <div className={s.dialog}>Маша</div>
              <div className={s.dialog}>Яна</div>
          </div>
          <div className={s.massages}>
              <div className={s.massage}>Привет, нужна помощь</div>
              <div className={s.massage}>Привет, как дела? </div>
              <div className={s.massage}>Привет, с ДР тебя!!!!!</div>
          </div>



      </div>
  )
};


export default Dialogs;
